  <li><i>Self/Peer Assessment</i>.  All too often, SNCOs have stated they have not received feedback from their peers.  Many have stated they have not received feedback from their supervisors in years.    During the ALE, you will actively contribute in the professional development of your fellow SNCOs by participating in experiential feedback activities.  You will give and receive feedback based on peer feedback criteria that concentrates on relevant and realistic observable leadership behavior.  During these assessments, you will address both demonstrated positive leadership qualities as well as areas in need of improvement.</li><li>
  <i>Stratification Exercise</i>.  The Airman Comprehensive Assessment (ACA) and the enlisted promotion process for Master Sergeants require you to stratify (i.e. rack-and-stack) Airmen.  You will do the same with your peers during the Stratification Exercise as you analyze their actions, decisions, behaviors, and overall contributions using peer feedback criteria.  This is not a popularity contest.  It is simply an opportunity for you to appropriately rank those members who actively and willfully demonstrated true Airmanship and leadership behaviors while selflessly contributing to the team’s success.</li></ul><p>The objective of the Self/Peer Assessment and Stratification Exercise is to enhance self-awareness and continual improvement.  Some of you might not like what you hear.  Some of you are going to take a bruising, and some of you will be a bruiser (if the baby is ugly then call it ugly).  Remember we learn more from our mistakes, trying experiences, and failure points and subsequently grow more from them.    If you are honest with yourself and others you will walk out the door as a better prepared SNCO to willingly give and receive feedback.</p><p><strong>EXPECTATIONS:</strong>  You are required to participate in both the Self/Peer Assessment and the Stratification Exercise.  It is critical that you accomplish the Self/Peer Assessment and the Stratification Exercise honestly and appropriately.  You are responsible for your ratings and may be required to explain your peer assessment ratings and rankings to SNCOA faculty representatives. At the conclusion of each peer feedback session in class, utilize the provided peer feedback to re-evaluate your Professional Leadership Development Plan (PLDP) Strengths/Weaknesses and Action Plan.  
  </p>','Nothing here!','2016-10-02T08:56:35-07:00');	












