INSERT INTO SpInstrument([ModifiedById],[Name],[IsActive],[Version],[StudentInstructions],[FacultyInstructions],[ModifiedDate]) VALUES(276,'Full Self/Peer Assessment','TRUE',0,'<p class="lead">As Senior Enlisted Leaders (SELs) and supervisors, it is our responsibility to willingly give and receive feedback and also to stratify members.  Feedback is essential to improving the proficiency, reliability, and advancement of our enlisted force, one Airman at a time.  Stratification will result in promotion considerations, reenlistments, and force shaping actions.</p><p>During the Advanced Leadership Experience (ALE), you have several opportunities to provide constructive feedback and to stratify your classmates.  These processes are the <strong>Self/Peer Assessment</strong> and the <strong>Stratification Exercise</strong>.</p><ul>
INSERT INTO SpInstrument([ModifiedById],[Name],[IsActive],[Version],[StudentInstructions],[FacultyInstructions],[ModifiedDate]) VALUES(276,'Half Self/Peer Assessment','TRUE',0,'<p class="lead">As Senior Enlisted Leaders (SELs) and supervisors, it is our responsibility to willingly give and receive feedback and also to stratify members.  Feedback is essential to improving the proficiency, reliability, and advancement of our enlisted force, one Airman at a time.  Stratification will result in promotion considerations, reenlistments, and force shaping actions.</p><p>During the Advanced Leadership Experience (ALE), you have several opportunities to provide constructive feedback and to stratify your classmates.  These processes are the <strong>Self/Peer Assessment</strong> and the <strong>Stratification Exercise</strong>.</p><ul><li><i>Self/Peer Assessment</i>.  All too often, SNCOs have stated they have not received feedback from their peers.  Many have stated they have not received feedback from their supervisors in years.    During the ALE, you will actively contribute in the professional development of your fellow SNCOs by participating in experiential feedback activities.  You will give and receive feedback based on peer feedback criteria that concentrates on relevant and realistic observable leadership behavior.  During these assessments, you will address both demonstrated positive leadership qualities as well as areas in need of improvement.</li><li><i>Stratification Exercise</i>.  The Airman Comprehensive Assessment (ACA) and the enlisted promotion process for Master Sergeants require you to stratify (i.e. rack-and-stack) Airmen.  You will do the same with your peers during the Stratification Exercise as you analyze their actions, decisions, behaviors, and overall contributions using peer feedback criteria.  This is not a popularity contest.  It is simply an opportunity for you to appropriately rank those members who actively and willfully demonstrated true Airmanship and leadership behaviors while selflessly contributing to the team’s success.</li></ul><p>The objective of the Self/Peer Assessment and Stratification Exercise is to enhance self-awareness and continual improvement.  Some of you might not like what you hear.  Some of you are going to take a bruising, and some of you will be a bruiser (if the baby is ugly then call it ugly).  Remember we learn more from our mistakes, trying experiences, and failure points and subsequently grow more from them.    If you are honest with yourself and others you will walk out the door as a better prepared SNCO to willingly give and receive feedback.</p><p><strong>EXPECTATIONS:</strong>  You are required to participate in both the Self/Peer Assessment and the Stratification Exercise.  It is critical that you accomplish the Self/Peer Assessment and the Stratification Exercise honestly and appropriately.  You are responsible for your ratings and may be required to explain your peer assessment ratings and rankings to SNCOA faculty representatives. At the conclusion of each peer feedback session in class, utilize the provided peer feedback to re-evaluate your Professional Leadership Development Plan (PLDP) Strengths/Weaknesses and Action Plan.</p>','per conubia nostra, per inceptos hymenaeos. Mauris ut quam vel sapien imperdiet ornare. In faucibus. Morbi vehicula. Pellentesque tincidunt tempus risus. Donec egestas. Duis ac arcu. Nunc mauris. Morbi non sapien molestie orci tincidunt adipiscing. Mauris molestie pharetra nibh. Aliquam ornare, libero at auctor ullamcorper, nisl arcu iaculis enim, sit amet ornare lectus justo eu arcu. Morbi sit amet massa. Quisque porttitor eros nec tellus. Nunc lectus pede, ultrices a, auctor non, feugiat nec, diam. Duis mi enim, condimentum eget, volutpat ornare, facilisis eget, ipsum. Donec sollicitudin adipiscing ligula. Aenean gravida nunc sed pede. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Proin vel arcu eu o