INSERT INTO [dbo].[CogInstrument] ([ModifiedById], [Version], [IsActive], [CogInstructions], [CogInstrumentType], [ModifiedDate]) VALUES (13, N'1', 1, N'<p>As part of this course, you will be learning about your personal problem solving style (also called cognitive style), which is your preferred way of approaching and addressing problems. For this purpose, we will be using an inventory called the e-CPE (electronic-Cognitive Preference Estimator), which is a validated instrument based upon Dr. M.J. Kirton’s Adaption- Innovation theory. This instrument measures your preferred problem solving style only. It does not measure your IQ or your ability to solve problems. <br/><br/> Instead, the e-CPE assesses what you “prefer” to do, not what you “can” do or “should” do. Some items of the e-CPE will reflect your natural preferences and will be more comfortable (easier) for you to do consistently, over time. Other items will not reflect your preferences and will be less comfortable (harder) to do. Move the slider to the area best reflecting your preference toward a behavior—this is done by moving the slider from midpoint toward the left or right of the scale. The closer you move the pointer to the left or right portrays the easier you find yourself reflecting/acknowledging that behavior as your preference. We should vary on which items we view as harder or easier to do than others – and that is what makes us unique. That being said everything should not be at midpoint or at left or right point on the scale. <br/><br/> Once we understand these differences, we can put them to better use. So, as you accomplish the instrument do not try to “game” it. Be aware that there is no “school answer or school preference”—this is information about you and will only be helpful if you answer honestly. Also, answer the items in the frame of reference as this is my “preferred state of being” not my work or home environment realities. <br/><br/> It will take approximately 5-10 minutes to complete the inventory. Your results are completely confidential; it will be your choice to share your results with others. Take time to do this well as it gives you very important information about yourself that will be used throughout the course.</p>', N'ECPE', N'2015-06-25 14:33:52');
INSERT INTO [dbo].[CogInstrument] ([ModifiedById], [Version], [IsActive], [CogInstructions], [CogInstrumentType], [ModifiedDate]) VALUES (13, N'1', 1, N'<p>Move the slider to the area best reflecting how much a behavior describes you—this is done by moving the slider from midpoint toward the top or bottom of the scale. The closer you move the pointer to the top or bottom portrays how much the behavior describes you. Your selection does not have to line up exactly with a word, if you feel that you display the behavior somewhere between "Quite a lot like me" and "Somewhat like me" move the slider between. That being said everything should not be at midpoint or at top or bottom point on the scale.</p>', N'ECMSPE', N'2015-06-25 14:33:52');
INSERT INTO [dbo].[CogInstrument] ([ModifiedById], [Version], [IsActive], [CogInstructions], [CogInstrumentType], [ModifiedDate]) VALUES (13, N'1', 1, N'<p>Move the slider to the area best reflecting your tendency toward a behavior—this is done by moving the slider from midpoint toward the left or right of the scale. The closer you move the pointer to the left or right portrays how often you find yourself reflecting/acknowledging that behavior. Your selection does not have to line up exactly with a word, if you feel that you display the behavior somewhere between "Mostly" and "Usually" move the slider between. That being said everything should not be at midpoint or at left or right point on the scale.</p>', N'ESALB', N'2015-06-25 14:33:52');
INSERT INTO [dbo].[CogInstrument] ([ModifiedById], [Version], [IsActive], [CogInstructions], [CogInstrumentType], [ModifiedDate]) VALUES (13, N'1', 1, N'<p>Select the manner that best reflects how much a behavior describes you—this is done by selecting a button from the list.</p>', N'ETMPRE', N'2015-06-25 14:33:52');
